import Head from 'next/head'
import useStore from '../components/bag'

export default function Bag() {
    const { bag } = useStore()

    return (
        <div className="container">
            <Head>
                <title>Bag</title>
                <link rel="icon" href="/favicon.ico" />
            </Head>

            <main>
                <ul>
                    {bag.map(item => (
                        <li key="item">{item.name}</li>
                    ))}
                </ul>
                <button onClick={() => addTobag({ name: 'item' })}>Add</button>
            </main>
        </div>
    )
}
